import Layout from "../layout";

function Men() {
  return (
    <Layout>
      <div className="w-4/5 mt-20 m-20">
        <h2 className="text-xl">Men's Shoes ()</h2>
        <div className="mt-4 *:inline-block">
          <div className="w-1/3">
            <p>Price</p>
            <p>Offers</p>
            <p>Color</p>
          </div>
          <div className="w-2/3">Products</div>
        </div>
      </div>
    </Layout>
  );
}

export default Men;
